import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Users from './user/pages/Users';

function App() {
	return (
		<BrowserRouter>
			<Routes>
				<Route path="/" element={<Users />}></Route>
			</Routes>
			<Navigate to="/" />
		</BrowserRouter>
	);
}

export default App;
